import {TopBar} from "./App";
import {useEffect, useState} from 'react';
import Alert from 'react-bootstrap/Alert';
import Button from 'react-bootstrap/Button';
import {Form} from "react-bootstrap";
import Card from 'react-bootstrap/Card';
import  './questionnaire.css';


const Questionnaire = () => {
    const [data, setData] = useState({});
    const [show, setShow] = useState(true);

  useEffect(() => {
    // 发送 GET 请求到 Flask 后端
    fetch('/questionnaire/')
      .then(response => response.json())
      .then(data => {
        setData(data);
      })
      .catch(error => {
        console.error('Error:', error);
      });
  }, []);
  return (
      <>
          <TopBar/>
          <div className="App">
              <p>Data from Flask: {data.message}</p>
          </div>
          <Alert show={show} variant="danger">
              <Alert.Heading>Notice!</Alert.Heading>
              <p>
                  We are not able to collect your private information, these questions just help us to better analyse the results.
              </p>
              <hr />
              <div className="d-flex justify-content-end">
                  <Button onClick={() => setShow(false)} variant="outline-danger">Close</Button>
              </div>
          </Alert>
          <Card>
              <Card.Header>Questionnaire</Card.Header>
              <Card.Body>
                  <blockquote className="blockquote mb-0">
                      <p>
                          {' '}
                          Please complete the following Questionnaire
                      </p>
                      <footer className="blockquote-footer">
                          <p> 1. What is your biological gender?</p>
                          <Form>
                              {['radio'].map((type) => (
                                  <div key={`default-${type}`} className="mb-3">
                                      <Form.Check
                                          type={type}
                                          name={"gender"}
                                          id={"female"}
                                          label={"Female"}
                                      />
                                      <Form.Check
                                          type={type}
                                          name={"gender"}
                                          label={`Male`}
                                          id={"male"}
                                      />
                                       <Form.Check
                                          type={type}
                                           name={"gender"}
                                          label={`Perfer not to say`}
                                          id={"pns"}
                                      />
                                  </div>
                              ))}
                          </Form>
                           <p> 2. What is your age?</p>
                          <Form>
                              {['radio'].map((type) => (
                                  <div key={`default-${type}`} className="mb-3">
                                      <Form.Check
                                          type={type}
                                          name={"age"}
                                          id={"u35"}
                                          label={"Under 35"}
                                      />
                                      <Form.Check
                                          type={type}
                                          name={"age"}
                                          label={`35 - 60`}
                                          id={"35to60"}
                                      />
                                       <Form.Check
                                          type={type}
                                          name={"age"}
                                          label={`Up to 60`}
                                          id={"u60"}
                                      />
                                       <Form.Check
                                          type={type}
                                          name={"age"}
                                          label={`Perfer not to say`}
                                          id={"pnsa"}
                                      />
                                  </div>
                              ))}
                          </Form>
                          <div id = "button">
                              <Button id = "submit" variant="warning">Submit</Button>
                          </div>
                      </footer>
                  </blockquote>
              </Card.Body>
          </Card>
      </>
  );}
export default Questionnaire;
